function loadBookingList(o=1){$.ajax({method:"GET",url:URL_BOOKING_SITTER,data:{page:o}}).done(function(o){$("#booking-list").html(o)})}$(document).ready(function(){IS_LOGIN&&loadBookingList()}),$(document).on("click",".pagination a",function(o){o.preventDefault();var t=$(this).attr("href").split("page=")[1];IS_LOGIN&&loadBookingList(t)});